documentation/metadata.html.body:
Querying mapping metadata


This section will cover the mapping metadata interface. It provides easy
to use read-only access to all important properties or aspects of the
currently active mapping definitions.


The following sections will give some code examples how to use the
mapping query interfaces. The most important interface in the whole
process is org.dozer.metadata.MappingMetadata. An instance can be
acquired by calling the getMappingMetadata() method of the
DozerBeanMapper class. This call will initialize the mappings if the map
method has not been called yet.


Consider the following mapping file:






        org.dozer.vo.ClassA
        org.dozer.vo.ClassB

            fieldA
            fieldB






To begin querying the mapping definitions the following code is needed:



DozerBeanMapper mapper = new DozerBeanMapper();
mapper.setMappingFiles(listOfFiles);
MappingMetadata mapMetadata = beanMapper.getMappingMetadata();



Now that a reference to MappingMetadata is obtained we can start
querying for a certain class mapping definition:



try {
  ClassMappingMetadata classMappingMetadata =
      mapMetadata.getClassMapping(ClassA.class, ClassB.class);
} catch (MetadataLookupException e) {
  // couldn't find it
}



When holding a reference to a ClassMappingMetadata interface, queries
for individual field mappings can be executed:



try {
  FieldMappingMetadata fieldMetadata = classMetadata.getFieldMappingBySource("fieldA");
  // Destination: fieldB
  System.out.println("Destination: " + fieldMetadata.getDestinationName());
} catch (MetadataLookupException e) {
  // couldn't find it
}



For extensive documentation on the different interfaces please refer to
the JavaDoc.

documentation/xmlbeans.html.body:
3rd Party Object Factories


Dozer supports mapping of plain Java objects to frameworks that require
instantiation of objects via certain convention of calling factory
methods. To reproduce the expected behavior custom bean factories should
be used.


Mapping JAXB Objects

Dozer has support for mapping POJOs to JAXB objects. Use the
JAXBBeanFactory for any JAXB objects you want create.




    org.dozer.vo.TestObject

    org.dozer.vo.jaxb.employee.Employee


        name
        firstName


        street
        address.street






Mapping XMLBeans

Dozer has support for mapping POJOs to XMLBeans objects. Use the
XMLBeanFactory for any XMLBeans you want created. This factory will also
be used for mapping any fields that need to be instantiated in a deep
mapping that are not regular POJOs but are XMLBeans.




    org.dozer.vo.TestObject

    org.dozer.vo.GetWeatherByZipCodeDocument


        one
        GetWeatherByZipCode.zipCode





The unit test:



// Map from TestObject to XMLBeans
TestObject to = new TestObject();
to.setOne("one");

GetWeatherByZipCodeDocument doc = mapper.map(to, GetWeatherByZipCodeDocument.class);

assertEquals(to.getOne(), doc.getGetWeatherByZipCode().getZipCode());

// Map from XMLBeans to TestObject
GetWeatherByZipCodeDocument res = GetWeatherByZipCodeDocument.Factory.newInstance();
GetWeatherByZipCode zipCode = res.addNewGetWeatherByZipCode();
zipCode.setZipCode("one");

TestObject to2 = mapper.map(res, TestObject.class);

assertEquals(res.getGetWeatherByZipCode().getZipCode(), to2.getOne());
